Have you ever just decided you didn’t like something on your Jeep anymore?
I knew I would eventually want more of a slim look and for the past year or so I decided I just didn’t like the look of my current fenders. Apart from the look I knew that a more slim fender would allow more flex with big tires! 

Im like a kid in a candy store right now holding these @motobilt_inc 2” Crusher Fenders! I have been amazed by Motobilts work and products for quite some time now and when I saw these on @fiftyseven_jku rig I knew I had to have them! I am so happy to have something of theirs of my own to run on Miss Sarge! 
Shipping time was immaculate! Placed my order and they were shipped same day! Received these 2 days later! Talk about a quick turn around! 
Now off to be powder coated they go! 🤘🏼

