First off I am beyond ready for end of day tomorrow because I NEED the trails right now!
Monday I started back at the gym AND I started for the first time ever counting macros as I am trying to eat more clean and give my body what it needs. It is definitely a learning experience and I am still trying to figure things out but it is really exciting for me! I’ll have to keep you guys posted on how well I do with this on a wheeling weekend though. It would have probably been smarter to not go out of town the first week I started dieting. 😆…stay tuned lol. 

In addition to my little sand bike wheelie situation (see reel) I fell off a skateboard a few weeks back and landed completely on the right side of my face and left wrist and well my wrist is still just not having it. Considering I drive with my left hand the majority of the time..that should also make for an interesting weekend. 

ANYWAYS hope you all have had a great week and as @jasonk_jku would say LETS GO WHEELING!!! 🤪

